import React, { PureComponent } from 'react';
import { withRouter } from 'react-router-dom';
import {
  Radar, RadarChart, PolarGrid, PolarAngleAxis, PolarRadiusAxis,
} from 'recharts';

const Rader = (props) => {
    const data = [
        {
          subject: '연기', A: props.point.point_act, fullMark: 25,
        },
        {
          subject: '연출', A: props.point.point_dir, fullMark: 25,
        },
        {
          subject: 'OST', A: props.point.point_ost, fullMark: 25,
        },
        {
          subject: '스토리', A: props.point.point_sto, fullMark: 25,
        },
        {
          subject: '영상미', A: props.point.point_vis, fullMark: 25,
        }
      ];
    return (
      <RadarChart cx={125} cy={125} outerRadius={80} width={250} height={250} data={data} >
        <PolarGrid />
        <PolarAngleAxis dataKey="subject" />
        <PolarRadiusAxis />
        <Radar dataKey="A" stroke="#8884d8" fill="#8884d8" fillOpacity={0.6}/>
      </RadarChart>
    );
}
export default withRouter(Rader)
